contracts/project.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract CrowdFunding {

    string id;
    string name;
    string description;
    uint goal;
    uint funds;
    address payable author;
    string state;

    constructor(string memory _id, string memory _name, string memory _description, uint _goal) {
        id = _id;
        name = _name;
        description= _description;
        goal = _goal;
        author = payable(msg.sender); // La convertimos a tipo payable
        funds = 0;
        state = 'Opened';
    }

    function fundProject() public payable notAuthor {
        author.transfer(msg.value);
        funds += msg.value;
    }

    function changeProjectState(string calldata newState) public onlyAuthor {
        state = newState;

    }

    modifier onlyAuthor() {
        require(
            msg.sender == author,
            'Only author can change the state of the project'
        );
        _;
    }

    modifier notAuthor() {
        require(
            msg.sender != author,
            'The author cannot fund the project'
        );
        _;
    }
}

